import { Link, Route, BrowserRouter as Router } from "react-router-dom";

import Main from "./Main";
import React from "react";

function Header() {
  return (
    <Router>
      <div className="App">
        <nav className="navBar">
          <ul>
            <li>
              <Link to="/">Home</Link>
            </li>
            <li>
              <Link
                to={{
                  pathname: "/embed/",
                  state: {
                    title: "Basic Embed"
                  }
                }}
              >
                Basic Embed
              </Link>
            </li>
            <li>
              <Link to="/embed2">Embed2</Link>
            </li>
          </ul>
        </nav>

        <Main />
      </div>
    </Router>
  );
}

export default Header;
